package org.examples.day14;

public class ClassWithObjectInitilization {
	
	int x;
    String name;

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		ClassWithObjectInitilization myObj1 = new ClassWithObjectInitilization();  // Object 1
        myObj1.x = 5;
        myObj1.name = "Manasa";
        System.out.println(myObj1.x);
        System.out.println(myObj1.name);

	}

}
